import React from "react";
import { Parallax } from "react-parallax";

const image2 =
  "https://images.unsplash.com/photo-1528747045269-390fe33c19f2?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1650&q=80";

export const ContactPage = () => {
  return (
    <Parallax bgImage={image2} blur={{ min: -10, max: 10 }} strength={-100}>
      <div className="contact" id="contact">
        Contact
      </div>
    </Parallax>
  );
};

export default ContactPage;
